import React from 'react';
import classes from './post.module.css';
import { Contextt } from '../../app2';

export default (props) => {
    return (
        <Contextt.Consumer>
            <div className={classes.card}> 
                <div className={classes.header}>
                    <span> {Contextt.author}</span>
                    <b> {Contextt.date}</b>
                </div>
                <div className={classes.comment}>
                    <h2>{Contextt.title}</h2>
                    <p>{Contextt.disc}</p>
                </div>
                <i className={classes.comment_ctn}>0</i>
            </div> 
        </Contextt.Consumer>
    );
}
